  [],\n\t\"revision_timestamp\": \"2015-05-06T21:46:21.123147\",\n\t\"name\": \"integration-of-dsts-for-non-conflicting-end-to-end-flight-scheduling-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In this SBIR effort we propose an innovative
  approach for thenintegration of Decision Support Tools (DSTs) for increased situationalnawareness,
  improved cooperative scheduling and collaborativendecision-making in all parts of
  the air space. We propose to investigatentwo types of integration models based on
  the extent and feasibility ofnthe level of integration and use appropriate game
  theoretic approachesnto analyze these models. The proposed models are: (i) Data-sharing
  DSTnintegration model: In this model, DSTs will primarily share data that isnrequired
  for each DST to take a decision before an event happens. Basednon the shared data
  each DST acts independently (ii) Interacting DSTnintegration model: In this model,
  DSTs not only share data but alsonadvise each other to act in such a way to reduce
  the level of conflict.nTools based on repeated strategic games and cooperative bargaining
  gamesnwill be used. We primarily focus on integrating Traffic ManagementnAdvisories
  (TMAs) across multiple centers as the application domain fornthe Phase I effort.\",\n\t\"license_title\":
